import React from 'react';
import './MVB.css'

class MVB extends React.Component {

    constructor(props){
        super(props);
    }

    render() {
        return(
            <div>
                <img src=""/>
                <div id="MVBtext">
                    <div id="MVBWinLoseWinrate">
                        <div id="MVBWinLose"></div>
                        <div id="MVBWinrate"></div>
                    </div>
                    <div id="MVBKDA">KDA</div>
                </div>
            </div>
        );
    }

}

export default MVB;
